--------------------------------------------------------------------------------
-- Data Types                                                                 --
--------------------------------------------------------------------------------
--type SNum       = Int
--type Code       = String
type Byte       = Word8
type TokenID    = [Accept Code]
type Transition = Map SNum (SNum,TokenID)
type Automata   = Array Int Transition
type Lexeme     = String
newtype Tokens  = Tokens {getSeq :: Map SNum (Seq Token,SNum)}
type LexTree    = FingerTree Tokens Byte

data Token = Token { lexeme      :: Lexeme
                   , token_id    :: TokenID}
{-data Accept a
  = Acc { accPrio       :: Int,
          accAction     :: Maybe a,
          accLeftCtx    :: Maybe CharSet, -- cannot be converted to byteset at this point.
          accRightCtx   :: RightContext SNum
    }
    deriving (Eq,Ord)-}



--------------------------------------------------------------------------------
-- Instances                                                                  --
--------------------------------------------------------------------------------
instance Monoid Tokens where
  mempty = Tokens mempty
  mappend = combineTokens

instance F.Measured Tokens Byte where
  measure byte = let t = automata ! fromEnum byte
                 in Tokens $ Map.map (\os -> (singleton (Token [toEnum (fromEnum byte)] (snd os)),fst os)) t

instance Show Tokens where
  show (Tokens seqs) = case Map.lookup (startState) seqs of
    Just (toks,_) -> foldlWithIndex (\str _ tok -> str ++"\n" ++ show tok) "" toks
    _             -> "Lexical error"

instance Show Token where
  show token = printf "%-11s:%s" (showID $ token_id token)
                                   (fixLex $ lexeme token)


--------------------------------------------------------------------------------
-- Functions that read the lexfile                                            --
--------------------------------------------------------------------------------

lexFile :: FilePath -> IO LexTree
lexFile file = readCode file >>= return . F.fromList

readCode :: FilePath -> IO [Byte]
readCode file = do
  handle <- openFile file ReadMode
  hSetEncoding handle utf8
  hGetContents handle >>= return . concatMap encode

lexCode :: String -> LexTree
lexCode = F.fromList . concatMap (encode)

--------------------------------------------------------------------------------
-- The Combinators for the tokens                                             --
--------------------------------------------------------------------------------

combineTokens :: Tokens -> Tokens -> Tokens
combineTokens toks1 toks2 = Map.foldlWithKey (combineSequence toks2) mempty (getSeq toks1)

combineSequence :: Tokens -> Tokens -> SNum -> (Seq Token,SNum) -> Tokens
combineSequence toks2 outToks inState (tokSeq1,midState) = 
  Tokens $ case Map.lookup midState (getSeq toks2) of
    Just (tokSeq2,outState) ->
      Map.insert inState (mergeTokens tokSeq1 tokSeq2,outState) (getSeq outToks)
    Nothing -> let _ :> t1end = viewr tokSeq1
               in case (token_id t1end,Map.lookup startState (getSeq toks2)) of
      (a:as,Just (tokSeq2,outState)) ->
        Map.insert inState (appendTokens tokSeq1 tokSeq2,outState) (getSeq outToks)
      _                              -> getSeq outToks
mergeTokens :: Seq Token -> Seq Token -> Seq Token
mergeTokens toks1 toks2 = 
  let toks1' :> token1 = viewr toks1
      token2 :< toks2' = viewl toks2
  in (toks1' |> Token (lexeme token1 ++ lexeme token2) (token_id token2)) >< toks2'
appendTokens :: Seq Token -> Seq Token -> Seq Token
appendTokens   = mappend

--------------------------------------------------------------------------------
-- Utility functions                                                          --
--------------------------------------------------------------------------------

tokens :: LexTree -> Tokens
tokens  = F.measure

encode :: Char -> [Word8]
encode  = map fromIntegral . go . fromEnum
 where
  go oc
   | oc <= 0x7f       = [oc]
   | oc <= 0x7ff      = [ 0xc0 + (oc `shiftR` 6)
                        , 0x80 + oc .&. 0x3f
                        ]
   | oc <= 0xffff     = [ 0xe0 + (oc `shiftR` 12)
                        , 0x80 + ((oc `shiftR` 6) .&. 0x3f)
                        , 0x80 + oc .&. 0x3f
                        ]
   | otherwise        = [ 0xf0 + (oc `shiftR` 18)
                        , 0x80 + ((oc `shiftR` 12) .&. 0x3f)
                        , 0x80 + ((oc `shiftR` 6) .&. 0x3f)
                        , 0x80 + oc .&. 0x3f
                        ]

showID :: TokenID -> String
showID tokenid = case tokenid of
  []   -> "No Token"
  accs -> show $ map show_acc_num accs
  where show_acc_num (Acc p _ _ _) = "Acc " ++ show p

fixLex :: Lexeme -> Lexeme
fixLex lexeme = foldl convert_linebreaks "" lexeme
  where convert_linebreaks str '\n' = str ++ "\\n"
        convert_linebreaks str c = str ++ [c]


